from typing import List

class Solution:
  def getWinner(self, arr: List[int], k: int) -> int:
    arrMax = max(arr)

    if k >= len(arr):
      return arrMax

    bound = k+1
    maxToBound = max(arr[:bound])
    for i, n in enumerate(arr):
      if n == maxToBound or n == arrMax:
        return n
      bbound = min(i+bound-1, len(arr)-1)
      maxToBound = max(maxToBound, arr[bbound])


s = Solution()
print(s.getWinner(arr = [2,1,3,5,4,6,7], k = 2)) # 5
print(s.getWinner(arr = [3,2,1], k = 10)) # 3
print(s.getWinner([1,25,35,42,68,70], 2)) # 70
